import React from "react";


function MainVideo() {
    return (  
        <div className="mainVideo">
            <iframe width="1904" height="804" src="https://www.youtube.com/embed/brZRDjFIFJs" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            <video controls>
                <iframe width="1904" height="804" src="https://www.youtube.com/embed/brZRDjFIFJs" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </video>
        </div>
    );
}

export default MainVideo;
